import uuid from 'uuid';
import React from 'react';
import { BrowserRouter, Switch, Route, Redirect } from 'react-router-dom';
import './App.css';
import { UsersRouter } from './routes/index';
import {
  Landing,
  Login,
  NoMatch
} from './views';

function App() {

    return (
      <>
      <BrowserRouter>

            <Switch>
              {UsersRouter}
              <Route key={uuid.v4()} component={NoMatch} />
            </Switch>

      </BrowserRouter>
      </>
    )
  }




/**
 * Export component
 */


export default App;
